import * as React from "react";
import Grid from "@mui/material/Grid";
import Typography from "@mui/material/Typography";
import MenuIcon from "@mui/icons-material/Menu";
import { Card } from "reactstrap";
import { CardActionArea, CardContent, CardMedia, TextField } from "@mui/material";
import  pricetag  from '/Users/andreimaracheuski/marketplace_project/my-app/src/others/pricetag.png'
import { Box } from "@mui/system";
import { Items } from "./home/Items";


export const PreFooter = () => {
  return (
    <>
    <Box sx={{
      display: 'flex',
      justifyContent: 'center' ,
      flexWrap: 'wrap',
      p: 1,
      m: 1,
      bgcolor: 'background.paper',
      maxWidth: 600,
      borderRadius: 1,
    }}>
    <Items/>
    <Items/>
    <Items/>
    </Box>
    <Box
      sx={{
        width: 500,
        maxWidth: '100%',
      }}
    >
      <TextField fullWidth label="userEmail" id="fullWidth" />
    </Box>
    </>
    )
};
